import React from 'react';
import { Container,Box,Text}from '@chakra-ui/react';

const Homepage= () => {
    return <Container maxW="xl" centerContent>    

    <Box
        d="flex"
        justifyContent="center"
        p={3}
        bg={"white"}
        w="100%"
        m="40px 0 15px 0"
        borderRadius="lg"
        borderWidth="1px"

        >


        <Text allign="center" fontSize={"4xl"} fontFamily="Work sans" color="black">ChatBox</Text>


    </Box>



    </Container>
    
};

export default Homepage
